import React from 'react';
import { BrowserRouter as Router, Routes,Route, } from 'react-router-dom';
import { About } from '../pages/Аксиа';
import { Главный } from '../pages/Главный';
import { Доставк } from '../pages/Доставк';
import { Контакт } from '../pages/Контакт';
import { Tele } from '../pages/Отзывы';
import { Navbar } from './Navbar';




export function Main() {

    return (
        <Router>
        <div>
         <Navbar/>
            <Routes>
                <Route path='/' element ={<About/>} />
                <Route path='/Главный' element ={<Главный/>} />
                <Route path='/Доставк' element ={<Доставк/>} />
                <Route path='/Контакт' element ={<Контакт/>} />
                <Route path='/menu' element ={<Tele/>} />
            </Routes>
        </div>
        </Router>
    );
}
